update comb_advplatform_tag_reports_merge_weights
set field='media' 
where field='0';

update comb_advplatform_tag_reports_merge_weights
set field='industry' 
where field='1';

update comb_advplatform_tag_reports_merge_weights
set field='age' 
where field='2';

update comb_advplatform_tag_reports_merge_weights
set field='gender' 
where field='3';

update comb_advplatform_tag_reports_merge_weights
set field='region' 
where field='4';


select t1.field,t2.field,t3.field
	,sum(t1.vec1*t2.vec1*t3.vec1
			+t1.vec2*t2.vec2*t3.vec2
			+t1.vec3*t2.vec3*t3.vec3
			+t1.vec4*t2.vec4*t3.vec4
			+t1.vec5*t2.vec5*t3.vec5)
from comb_advplatform_tag_reports_merge_weights t1	
left join comb_advplatform_tag_reports_merge_weights t2 on t1.type=t2.type and t2.field='gender'
left join comb_advplatform_tag_reports_merge_weights t3 on t1.type=t3.type and t3.field='region'
where t1.type='w2' and t1.field='age'


create view vw_comb_advplatform_tag_reports_merge_weights_age
as
select * from comb_advplatform_tag_reports_merge_weights where type='w2' and field='age';

create view vw_comb_advplatform_tag_reports_merge_weights_gender
as
select * from comb_advplatform_tag_reports_merge_weights where type='w2' and field='gender';

create view vw_comb_advplatform_tag_reports_merge_weights_region
as
select * from comb_advplatform_tag_reports_merge_weights where type='w2' and field='region';

create view vw_comb_advplatform_tag_reports_merge_weights_media
as
select * from comb_advplatform_tag_reports_merge_weights where type='w2' and field='media';

create view vw_comb_advplatform_tag_reports_merge_weights_industry
as
select * from comb_advplatform_tag_reports_merge_weights where type='w2' and field='industry';


select t4.idx,t5.idx,t1.idx,t2.idx,t3.idx
	,   ( t1.vec1*t2.vec1*t3.vec1*t4.vec1*t5.vec1
			+t1.vec2*t2.vec2*t3.vec2*t4.vec2*t5.vec2
			+t1.vec3*t2.vec3*t3.vec3*t4.vec3*t5.vec3
			+t1.vec4*t2.vec4*t3.vec4*t4.vec4*t5.vec4
			+t1.vec5*t2.vec5*t3.vec5*t4.vec5*t5.vec5)
 as val
from vw_comb_advplatform_tag_reports_merge_weights_age t1
join vw_comb_advplatform_tag_reports_merge_weights_gender t2 on t2.idx in ('FEMALE','MALE')
join vw_comb_advplatform_tag_reports_merge_weights_region t3
join vw_comb_advplatform_tag_reports_merge_weights_media t4
join vw_comb_advplatform_tag_reports_merge_weights_industry t5
order by val desc













